import React, { Component } from "react";
import SHOP_DATA from "./ShopPage.data";

class ShopPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      collections: ["hey"],
    };
  }
  render() {
    return <h1>Swraj Samant Singh</h1>;
  }
}

export default ShopPage;
